$(document).ready(function e(){$("#form-check").on("submit",function e(t){t.preventDefault();var s=t.currentTarget.action;$.ajax({type:"POST",url:s,dataType:"json",data:$(this).serialize(),success:function e(t){if(t.result){$("#check-results").val(t.result);$("#check-results").parents(".row").removeClass("d-none")}if(t.status===true){$("#check-results").parents(".row").addClass("d-none");$("#result-new-modal").find(".alert-success").removeClass("d-none").empty().append(t.message);$("#result-new-modal").modal("show")}}})})});$(document).ready(function e(){$("#form-new-result").on("submit",function e(t){t.preventDefault();var s=t.currentTarget.action;$.ajax({type:"POST",url:s,dataType:"json",data:$(this).serialize(),success:function e(t){if(t.status){window.location=t.location}else{$("#result-new-modal").find(".alert-danger").removeClass("d-none").empty().append(t.message)}}})})});